import React, {useEffect} from 'react'
import Todo from "./Todo";
import {getTodos} from "../jobs";

const TodoList = () => {
    let todos = {}
   todos = getTodos()
    console.log(todos)

    return(
        <>
            <ul>
                {todos.map(item => (
                    <li key={item.id}>
                        <Todo item/>
                    </li>
                ))}
            </ul>
        </>
    )
}
export default TodoList
